ents\";'),('en','messages:expand_templates_remove_nowiki','s:32:\"Suppress <nowiki> tags in result\";'),('en','messages:expand_templates_generate_xml','s:19:\"Show XML parse tree\";'),('en','messages:expand_templates_generate_rawhtml','s:13:\"Show raw HTML\";'),('en','messages:expand_templates_preview','s:7:\"Preview\";'),('en','messages:expand_templates_preview_fail_html','s:318:\"<em>Because {{SITENAME}} has raw HTML enabled and there was a loss of session data, the preview is hidden as a precaution against JavaScript attacks.</em>\n\n<strong>If this is a legitimate preview attempt, please try again.</strong>\nIf it still does not work, try [[Special:UserLogout|logging out]] and logging back in.\";'),('en','messages:expand_templates_preview_fail_html_anon','s:253:\"<em>Because {{SITENAME}} has raw HTML enabled and you are not logged in, the preview is hidden as a precaution against JavaScript attacks.</em>\n\n<strong>If this is a legitimate preview attempt, please [[Special:UserLogin|log in]] and try again.</strong>\";'),('en','messages:pagelanguage','s:22:\"Page language selector\";'),('en','messages:pagelang-name','s:4:\"Page\";'),('en','messages:pagelang-language','s:8:\"Language\";'),('en','messages:pagelang-use-default','s:20:\"Use default language\";'),('en','messages:pagelang-select-lang','s:15:\"Select language\";'),('en','messages:right-pagelang','s:20:\"Change page language\";'),('en','messages:action-pagelang','s:24:\"change the page language\";'),('en','messages:log-name-pagelang','s:19:\"Change language log\";'),('en','messages:log-description-pagelang','s:43:\"This is a log of changes in page languages.\";'),('en','messages:logentry-pagelang-pagelang','s:60:\"$1 {{GENDER:$2|changed}} page language for $3 from $4 to $5.\";'),('en','messages:default-skin-not-found','s:1658:\"Whoops! The default skin for your wiki, defined in <code dir=\"ltr\">$wgDefaultSkin</code> as <code>$1</code>, is not available.\n\nYour installation seems to include the following {{PLURAL:$4|skin|skins}}. See [https://www.mediawiki.org/wiki/Manual:Skin_configuration Manual: Skin configuration] for information how to enable {{PLURAL:$4|it|them and choose the default}}.\n\n$2\n\n; If you have just installed MediaWiki:\n: You probably installed from git, or directly from the source code using some other method. This is expected. Try installing some skins from [https://www.mediawiki.org/wiki/Category:All_skins mediawiki.org\'s skin directory], by:\n:* Downloading the [https://www.mediawiki.org/wiki/Download tarball installer], which comes with several skins and extensions. You can copy and paste the <code>skins/</code> directory from it.\n:* Downloading individual skin tarballs from [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* [https://www.mediawiki.org/wiki/Download_from_Git#Using_Git_to_download_MediaWiki_skins Using Git to download skins].\n: Doing this should not interfere with your git repository if you\'re a MediaWiki developer.\n\n; If you have just upgraded MediaWiki:\n: MediaWiki 1.24 and newer no longer automatically enables installed skins (see [https://www.mediawiki.org/wiki/Manual:Skin_autodiscovery Manual: Skin autodiscovery]). You can paste the following {{PLURAL:$5|line|lines}} into <code>LocalSettings.php</code> to enable {{PLURAL:$5|the|all}} installed {{PLURAL:$5|skin|skins}}:\n\n<pre dir=\"ltr\">$3</pre>\n\n; If you have just modified <code>LocalSettings.php</code>:\n: Double-check the skin names for typos.\";'),('en','messages:default-skin-not-found-no-skins','s:1178:\"Whoops! The default skin for your wiki, defined in <code>$wgDefaultSkin</code> as <code>$1</code>, is not available.\n\nYou have no installed skins.\n\n; If you have just installed or upgraded MediaWiki:\n: You probably installed from git, or directly from the source code using some other method. This is expected. MediaWiki 1.24 and newer doesn\'t include any skins in the main repository. Try installing some skins from [https://www.mediawiki.org/wiki/Category:All_skins mediawiki.org\'s skin directory], by:\n:* Downloading the [https://www.mediawiki.org/wiki/Download tarball installer], which comes with several skins and extensions. You can copy and paste the <code>skins/</code> directory from it.\n:* Downloading individual skin tarballs from [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* [https://www.mediawiki.org/wiki/Download_from_Git#Using_Git_to_download_MediaWiki_skins Using Git to download skins].\n: Doing this should not interfere with your git repository if you\'re a MediaWiki developer. See [https://www.mediawiki.org/wiki/Manual:Skin_configuration Manual: Skin configuration] for information how to enable skins and choose the default.\n\";'),('en','messages:default-skin-not-found-row-enabled','s:32:\"* <code>$1</code> / $2 (enabled)\";'),('en','messages:default-skin-not-found-row-disabled','s:39:\"* <code>$1</code> / $2 (\'\'\'disabled\'\'\')\";'),('en','messages:mediastatistics','s:16:\"Media statistics\";'),('en','messages:mediastatistics-summary','s:138:\"Statistics about uploaded file types. This only includes the most recent version of a file. Old or deleted versions of files are excluded.\";'),('en','messages:mediastatistics-nfiles','s:8:\"$1 ($2%)\";'),('en','messages:mediastatistics-nbytes','s:40:\"{{PLURAL:$1|$1 byte|$1 bytes}} ($2; $3%)\";'),('en','messages:mediastatistics-table-mimetype','s:9:\"MIME type\";'),('en','messages:mediastatistics-table-extensions','s:19:\"Possible extensions\";'),('en','messages:mediastatistics-table-count','s:15:\"Number of files\";'),('en','messages:mediastatistics-table-totalbytes','s:13:\"Combined size\";'),('en','messages:mediastatistics-header-unknown','s:7:\"Unknown\";'),('en','messages:mediastatistics-header-bitmap','s:13:\"Bitmap images\";'),('en','messages:mediastatistics-header-drawing','s:24:\"Drawings (vector images)\";'),('en','messages:mediastatistics-header-audio','s:5:\"Audio\";'),('en','messages:mediastatistics-header-video','s:6:\"Videos\";'),('en','messages:mediastatistics-header-multimedia','s:10:\"Rich media\";'),('en','messages:mediastatistics-header-office','s:6:\"Office\";'),('en','messages:mediastatistics-header-text','s:7:\"Textual\";'),('en','messages:mediastatistics-header-executable','s:11:\"Executables\";'),('en','messages:mediastatistics-header-archive','s:18:\"Compressed formats\";'),('en','messages:json-warn-trailing-comma','s:65:\"$1 trailing {{PLURAL:$1|comma was|commas were}} removed from JSON\";'),('en','messages:json-error-unknown','s:44:\"There was a problem with the JSON. Error: $1\";'),('en','messages:json-error-depth','s:41:\"The maximum stack depth has been exceeded\";'),('en','messages:json-error-state-mismatch','s:25:\"Invalid or malformed JSON\";'),('en','messages:json-error-ctrl-char','s:53:\"Control character error, possibly incorrectly encoded\";'),('en','messages:json-error-syntax','s:12:\"Syntax error\";'),('en','messages:json-error-utf8','s:56:\"Malformed UTF-8 characters, possibly incorrectly encoded\";'),('en','messages:json-error-recursion','s:59:\"One or more recursive references in the value to be encoded\";'),('en','messages:json-error-inf-or-nan','s:56:\"One or more NAN or INF values in the value to be encoded\";'),('en','messages:json-error-unsupported-type','s:50:\"A value of a type that cannot be encoded was given\";'),('en','messages:headline-anchor-title','s:20:\"Link to this section\";'),('en','messages:special-characters-group-latin','s:5:\"Latin\";'),('en','messages:special-characters-group-latinextended','s:14:\"Latin extended\";'),('en','messages:special-characters-group-ipa','s:3:\"IPA\";'),('en','messages:special-characters-group-symbols','s:7:\"Symbols\";'),('en','messages:special-characters-group-greek','s:5:\"Greek\";'),('en','messages:special-characters-group-cyrillic','s:8:\"Cyrillic\";'),('en','messages:special-characters-group-arabic','s:6:\"Arabic\";'),('en','messages:special-characters-group-arabicextended','s:15:\"Arabic extended\";'),('en','messages:special-characters-group-persian','s:7:\"Persian\";'),('en','messages:special-characters-group-hebrew','s:6:\"Hebrew\";'),('en','messages:special-characters-group-bangla','s:6:\"Bangla\";'),('en','messages:special-characters-group-tamil','s:5:\"Tamil\";'),('en','messages:special-characters-group-telugu','s:6:\"Telugu\";'),('en','messages:special-characters-group-sinhala','s:7:\"Sinhala\";'),('en','messages:special-characters-group-gujarati','s:8:\"Gujarati\";'),('en','messages:special-characters-group-devanagari','s:10:\"Devanagari\";'),('en','messages:special-characters-group-thai','s:4:\"Thai\";'),('en','messages:special-characters-group-lao','s:3:\"Lao\";'),('en','messages:special-characters-group-khmer','s:5:\"Khmer\";'),('en','messages:special-characters-title-endash','s:7:\"en dash\";'),('en','messages:special-characters-title-emdash','s:7:\"em dash\";'),('en','messages:special-characters-title-minus','s:10:\"minus sign\";'),('en','messages:mw-widgets-dateinput-no-date','s:16:\"No date selected\";'),('en','messages:mw-widgets-dateinput-placeholder-day','s:10:\"YYYY-MM-DD\";'),('en','messages:mw-widgets-dateinput-placeholder-month','s:7:\"YYYY-MM\";'),('en','messages:mw-widgets-titleinput-description-new-page','s:23:\"page does not exist yet\";'),('en','messages:mw-widgets-titleinput-description-redirect','s:14:\"redirect to $1\";'),('en','messages:api-error-blacklisted','s:45:\"Please choose a different, descriptive title.\";'),('en','messages:apihelp-main-description','s:976:\"<div class=\"hlist plainlinks api-main-links\">\n* [[mw:API:Main_page|Documentation]]\n* [[mw:API:FAQ|FAQ]]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api Mailing list]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce API Announcements]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Bugs & requests]\n</div>\n<strong>Status:</strong> All features shown on this page should be working, but the API is still in active development, and may change at any time. Subscribe to [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ the mediawiki-api-announce mailing list] for notice of updates.\n\n<strong>Erroneous requests:</strong> When erroneous requests are sent to the API, an HTTP header will be sent with the key \"MediaWiki-API-Error\" and then both the value of the header and the error code sent back will be set to the same value. For more information see [[mw:API:Errors_and_warnings|API: Errors and warnings]].\";'),('en','messages:apihelp-main-param-action','s:24:\"Which action to perform.\";'),('en','messages:apihelp-main-param-format','s:25:\"The format of the output.\";'),('en','messages:apihelp-main-param-maxlag','s:469:\"Maximum lag can be used when MediaWiki is installed on a database replicated cluster. To save actions causing any more site replication lag, this parameter can make the client wait until the replication lag is less than the specified value. In case of excessive lag, error code <samp>maxlag</samp> is returned with a message like <samp>Waiting for $host: $lag seconds lagged</samp>.<br />See [[mw:Manual:Maxlag_parameter|Manual: Maxlag parameter]] for more information.\";'),('en','messages:apihelp-main-param-smaxage','s:102:\"Set the <code>s-maxage</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),('en','messages:apihelp-main-param-maxage','s:101:\"Set the <code>max-age</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),('en','messages:apihelp-main-param-assert','s:100:\"Verify the user is logged in if set to <kbd>user</kbd>, or has the bot user right if <kbd>bot</kbd>.\";'),('en','messages:apihelp-main-param-requestid','s:91:\"Any value given here will be included in the response. May be used to distinguish requests.\";'),('en','messages:apihelp-main-param-servedby','s:60:\"Include the hostname that served the request in the results.\";'),('en','messages:apihelp-main-param-curtimestamp','s:44:\"Include the current timestamp in the result.\";'),('en','messages:apihelp-main-param-origin','s:660:\"When accessing the API using a cross-domain AJAX request (CORS), set this to the originating domain. This must be included in any pre-flight request, and therefore must be part of the request URI (not the POST body). This must match one of the origins in the <code>Origin</code> header exactly, so it has to be set to something like <kbd>https://en.wikipedia.org</kbd> or <kbd>https://meta.wikimedia.org</kbd>. If this parameter does not match the <code>Origin</code> header, a 403 response will be returned. If this parameter matches the <code>Origin</code> header and the origin is whitelisted, an <code>Access-Control-Allow-Origin</code> header will be set.\";'),('en','messages:apihelp-main-param-uselang','s:325:\"Language to use for message translations. A list of codes may be fetched from <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> with <kbd>siprop=languages</kbd>, or specify <kbd>user</kbd> to use the current user\'s language preference, or specify <kbd>content</kbd> to use this wiki\'s content language.\";'),('en','messages:apihelp-block-description','s:13:\"Block a user.\";'),('en','messages:apihelp-block-param-user','s:43:\"Username, IP address, or IP range to block.\";'),('en','messages:apihelp-block-param-expiry','s:233:\"Expiry time. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If set to <kbd>infinite</kbd>, <kbd>indefinite</kbd>, or <kbd>never</kbd>, the block will never expire.\";'),('en','messages:apihelp-block-param-reason','s:17:\"Reason for block.\";'),('en','messages:apihelp-block-param-anononly','s:78:\"Block anonymous users only (i.e. disable anonymous edits for this IP address).\";'),('en','messages:apihelp-block-param-nocreate','s:25:\"Prevent account creation.\";'),('en','messages:apihelp-block-param-autoblock','s:101:\"Automatically block the last used IP address, and any subsequent IP addresses they try to login from.\";'),('en','messages:apihelp-block-param-noemail','s:95:\"Prevent user from sending email through the wiki. (Requires the <code>blockemail</code> right).\";'),('en','messages:apihelp-block-param-hidename','s:81:\"Hide the username from the block log. (Requires the <code>hideuser</code> right).\";'),('en','messages:apihelp-block-param-allowusertalk','s:123:\"Allow the user to edit their own talk page (depends on <var>[[mw:Manual:$wgBlockAllowsUTEdit|$wgBlockAllowsUTEdit]]</var>).\";'),('en','messages:apihelp-block-param-reblock','s:61:\"If the user is already blocked, overwrite the existing block.\";'),('en','messages:apihelp-block-param-watchuser','s:53:\"Watch the user\'s or IP address\'s user and talk pages.\";'),('en','messages:apihelp-block-example-ip-simple','s:89:\"Block IP address <kbd>192.0.2.5</kbd> for three days with reason <kbd>First strike</kbd>.\";'),('en','messages:apihelp-block-example-user-complex','s:127:\"Block user <kbd>Vandal</kbd> indefinitely with reason <kbd>Vandalism</kbd>, and prevent new account creation and email sending.\";'),('en','messages:apihelp-checktoken-description','s:104:\"Check the validity of a token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\";'),('en','messages:apihelp-checktoken-param-type','s:27:\"Type of token being tested.\";'),('en','messages:apihelp-checktoken-param-token','s:14:\"Token to test.\";'),('en','messages:apihelp-checktoken-param-maxtokenage','s:45:\"Maximum allowed age of the token, in seconds.\";'),('en','messages:apihelp-checktoken-example-simple','s:45:\"Test the validity of a <kbd>csrf</kbd> token.\";'),('en','messages:apihelp-clearhasmsg-description','s:57:\"Clears the <code>hasmsg</code> flag for the current user.\";'),('en','messages:apihelp-clearhasmsg-example-1','s:56:\"Clear the <code>hasmsg</code> flag for the current user.\";'),('en','messages:apihelp-compare-description','s:123:\"Get the difference between 2 pages.\n\nA revision number, a page title, or a page ID for both \"from\" and \"to\" must be passed.\";'),('en','messages:apihelp-compare-param-fromtitle','s:23:\"First title to compare.\";'),('en','messages:apihelp-compare-param-fromid','s:25:\"First page ID to compare.\";'),('en','messages:apihelp-compare-param-fromrev','s:26:\"First revision to compare.\";'),('en','messages:apihelp-compare-param-totitle','s:24:\"Second title to compare.\";'),('en','messages:apihelp-compare-param-toid','s:26:\"Second page ID to compare.\";'),('en','messages:apihelp-compare-param-torev','s:27:\"Second revision to compare.\";'),('en','messages:apihelp-compare-example-1','s:39:\"Create a diff between revision 1 and 2.\";'),('en','messages:apihelp-createaccount-description','s:26:\"Create a new user account.\";'),('en','messages:apihelp-createaccount-param-name','s:9:\"Username.\";'),('en','messages:apihelp-createaccount-param-password','s:55:\"Password (ignored if <var>$1mailpassword</var> is set).\";'),('en','messages:apihelp-createaccount-param-domain','s:46:\"Domain for external authentication (optional).\";'),('en','messages:apihelp-createaccount-param-token','s:49:\"Account creation token obtained in first request.\";'),('en','messages:apihelp-createaccount-param-email','s:33:\"Email address of user (optional).\";'),('en','messages:apihelp-createaccount-param-realname','s:29:\"Real name of user (optional).\";'),('en','messages:apihelp-createaccount-param-mailpassword','s:67:\"If set to any value, a random password will be emailed to the user.\";'),('en','messages:apihelp-createaccount-param-reason','s:63:\"Optional reason for creating the account to be put in the logs.\";'),('en','messages:apihelp-createaccount-param-language','s:86:\"Language code to set as default for the user (optional, defaults to content language).\";'),('en','messages:apihelp-createaccount-example-pass','s:65:\"Create user <kbd>testuser</kbd> with password <kbd>test123</kbd>.\";'),('en','messages:apihelp-createaccount-example-mail','s:76:\"Create user <kbd>testmailuser</kbd> and email a randomly-generated password.\";'),('en','messages:apihelp-delete-description','s:14:\"Delete a page.\";'),('en','messages:apihelp-delete-param-title','s:78:\"Title of the page to delete. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-delete-param-pageid','s:79:\"Page ID of the page to delete. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-delete-param-reason','s:84:\"Reason for the deletion. If not set, an automatically generated reason will be used.\";'),('en','messages:apihelp-delete-param-watch','s:45:\"Add the page to the current user\'s watchlist.\";'),('en','messages:apihelp-delete-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-delete-param-unwatch','s:50:\"Remove the page from the current user\'s watchlist.\";'),('en','messages:apihelp-delete-param-oldimage','s:134:\"The name of the old image to delete as provided by [[Special:ApiHelp/query+imageinfo|action=query&prop=imageinfo&iiprop=archivename]].\";'),('en','messages:apihelp-delete-example-simple','s:28:\"Delete <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-delete-example-reason','s:74:\"Delete <kbd>Main Page</kbd> with the reason <kbd>Preparing for move</kbd>.\";'),('en','messages:apihelp-disabled-description','s:30:\"This module has been disabled.\";'),('en','messages:apihelp-edit-description','s:22:\"Create and edit pages.\";'),('en','messages:apihelp-edit-param-title','s:76:\"Title of the page to edit. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-edit-param-pageid','s:77:\"Page ID of the page to edit. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-edit-param-section','s:83:\"Section number. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('en','messages:apihelp-edit-param-sectiontitle','s:28:\"The title for a new section.\";'),('en','messages:apihelp-edit-param-text','s:13:\"Page content.\";'),('en','messages:apihelp-edit-param-summary','s:82:\"Edit summary. Also section title when $1section=new and $1sectiontitle is not set.\";'),('en','messages:apihelp-edit-param-tags','s:37:\"Change tags to apply to the revision.\";'),('en','messages:apihelp-edit-param-minor','s:11:\"Minor edit.\";'),('en','messages:apihelp-edit-param-notminor','s:15:\"Non-minor edit.\";'),('en','messages:apihelp-edit-param-bot','s:22:\"Mark this edit as bot.\";'),('en','messages:apihelp-edit-param-basetimestamp','s:168:\"Timestamp of the base revision, used to detect edit conflicts. May be obtained through [[Special:ApiHelp/query+revisions|action=query&prop=revisions&rvprop=timestamp]].\";'),('en','messages:apihelp-edit-param-starttimestamp','s:242:\"Timestamp when the editing process began, used to detect edit conflicts. An appropriate value may be obtained using <var>[[Special:ApiHelp/main|curtimestamp]]</var> when beginning the edit process (e.g. when loading the page content to edit).\";'),('en','messages:apihelp-edit-param-recreate','s:71:\"Override any errors about the page having been deleted in the meantime.\";'),('en','messages:apihelp-edit-param-createonly','s:41:\"Don\'t edit the page if it exists already.\";'),('en','messages:apihelp-edit-param-nocreate','s:41:\"Throw an error if the page doesn\'t exist.\";'),('en','messages:apihelp-edit-param-watch','s:45:\"Add the page to the current user\'s watchlist.\";'),('en','messages:apihelp-edit-param-unwatch','s:50:\"Remove the page from the current user\'s watchlist.\";'),('en','messages:apihelp-edit-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-edit-param-md5','s:159:\"The MD5 hash of the $1text parameter, or the $1prependtext and $1appendtext parameters concatenated. If set, the edit won\'t be done unless the hash is correct.\";'),('en','messages:apihelp-edit-param-prependtext','s:61:\"Add this text to the beginning of the page. Overrides $1text.\";'),('en','messages:apihelp-edit-param-appendtext','s:127:\"Add this text to the end of the page. Overrides $1text.\n\nUse $1section=new to append a new section, rather than this parameter.\";'),('en','messages:apihelp-edit-param-undo','s:69:\"Undo this revision. Overrides $1text, $1prependtext and $1appendtext.\";'),('en','messages:apihelp-edit-param-undoafter','s:79:\"Undo all revisions from $1undo to this one. If not set, just undo one revision.\";'),('en','messages:apihelp-edit-param-redirect','s:32:\"Automatically resolve redirects.\";'),('en','messages:apihelp-edit-param-contentformat','s:53:\"Content serialization format used for the input text.\";'),('en','messages:apihelp-edit-param-contentmodel','s:33:\"Content model of the new content.\";'),('en','messages:apihelp-edit-param-token','s:94:\"The token should always be sent as the last parameter, or at least after the $1text parameter.\";'),('en','messages:apihelp-edit-example-edit','s:12:\"Edit a page.\";'),('en','messages:apihelp-edit-example-prepend','s:47:\"Prepend <kbd>_&#95;NOTOC_&#95;</kbd> to a page.\";'),('en','messages:apihelp-edit-example-undo','s:52:\"Undo revisions 13579 through 13585 with autosummary.\";'),('en','messages:apihelp-emailuser-description','s:13:\"Email a user.\";'),('en','messages:apihelp-emailuser-param-target','s:22:\"User to send email to.\";'),('en','messages:apihelp-emailuser-param-subject','s:15:\"Subject header.\";'),('en','messages:apihelp-emailuser-param-text','s:10:\"Mail body.\";'),('en','messages:apihelp-emailuser-param-ccme','s:31:\"Send a copy of this mail to me.\";'),('en','messages:apihelp-emailuser-example-email','s:76:\"Send an email to user <kbd>WikiSysop</kbd> with the text <kbd>Content</kbd>.\";'),('en','messages:apihelp-expandtemplates-description','s:34:\"Expands all templates in wikitext.\";'),('en','messages:apihelp-expandtemplates-param-title','s:14:\"Title of page.\";'),('en','messages:apihelp-expandtemplates-param-text','s:20:\"Wikitext to convert.\";'),('en','messages:apihelp-expandtemplates-param-revid','s:71:\"Revision ID, for <nowiki>{{REVISIONID}}</nowiki> and similar variables.\";'),('en','messages:apihelp-expandtemplates-param-prop','s:158:\"Which pieces of information to get.\n\nNote that if no values are selected, the result will contain the wikitext, but the output will be in a deprecated format.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-wikitext','s:22:\"The expanded wikitext.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-categories','s:84:\"Any categories present in the input that are not represented in the wikitext output.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-properties','s:64:\"Page properties defined by expanded magic words in the wikitext.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-volatile','s:82:\"Whether the output is volatile and should not be reused elsewhere within the page.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-ttl','s:72:\"The maximum time after which caches of the result should be invalidated.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-modules','s:203:\"Any ResourceLoader modules that parser functions have requested be added to the output. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-jsconfigvars','s:66:\"Gives the JavaScript configuration variables specific to the page.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-encodedjsconfigvars','s:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),('en','messages:apihelp-expandtempla