y to return.\";'),('en','messages:apihelp-query+fileusage-param-show','s:108:\"Show only items that meet these criteria:\n;redirect:Only show redirects.\n;!redirect:Only show non-redirects.\";'),('en','messages:apihelp-query+fileusage-example-simple','s:48:\"Get a list of pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-example-generator','s:56:\"Get information about pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+imageinfo-description','s:44:\"Returns file information and upload history.\";'),('en','messages:apihelp-query+imageinfo-param-prop','s:30:\"Which file information to get:\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-timestamp','s:40:\"Adds timestamp for the uploaded version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-user','s:45:\"Adds the user who uploaded each file version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-userid','s:55:\"Add the ID of the user that uploaded each file version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-comment','s:23:\"Comment on the version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-parsedcomment','s:33:\"Parse the comment on the version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-canonicaltitle','s:37:\"Adds the canonical title of the file.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-url','s:47:\"Gives URL to the file and the description page.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-size','s:88:\"Adds the size of the file in bytes and the height, width and page count (if applicable).\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-dimensions','s:15:\"Alias for size.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-sha1','s:29:\"Adds SHA-1 hash for the file.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-mime','s:27:\"Adds MIME type of the file.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-thumbmime','s:74:\"Adds MIME type of the image thumbnail (requires url and param $1urlwidth).\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-mediatype','s:32:\"Adds the media type of the file.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-metadata','s:48:\"Lists Exif metadata for the version of the file.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-commonmetadata','s:63:\"Lists file format generic metadata for the version of the file.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-extmetadata','s:84:\"Lists formatted metadata combined from multiple sources. Results are HTML formatted.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-archivename','s:65:\"Adds the filename of the archive version for non-latest versions.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-bitdepth','s:34:\"Adds the bit depth of the version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-uploadwarning','s:119:\"Used by the Special:Upload page to get information about an existing file. Not intended for use outside MediaWiki core.\";'),('en','messages:apihelp-query+imageinfo-param-limit','s:43:\"How many file revisions to return per file.\";'),('en','messages:apihelp-query+imageinfo-param-start','s:32:\"Timestamp to start listing from.\";'),('en','messages:apihelp-query+imageinfo-param-end','s:29:\"Timestamp to stop listing at.\";'),('en','messages:apihelp-query+imageinfo-param-urlwidth','s:174:\"If $2prop=url is set, a URL to an image scaled to this width will be returned.\nFor performance reasons if this option is used, no more than $1 scaled images will be returned.\";'),('en','messages:apihelp-query+imageinfo-param-urlheight','s:22:\"Similar to $1urlwidth.\";'),('en','messages:apihelp-query+imageinfo-param-metadataversion','s:136:\"Version of metadata to use. If <kbd>latest</kbd> is specified, use latest version. Defaults to <kbd>1</kbd> for backwards compatibility.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatalanguage','s:180:\"What language to fetch extmetadata in. This affects both which translation to fetch, if multiple are available, as well as how things like numbers and various values are formatted.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatamultilang','s:74:\"If translations for extmetadata property are available, fetch all of them.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatafilter','s:84:\"If specified and non-empty, only these keys will be returned for $1prop=extmetadata.\";'),('en','messages:apihelp-query+imageinfo-param-urlparam','s:170:\"A handler specific parameter string. For example, PDFs might use <kbd>page15-100px</kbd>. <var>$1urlwidth</var> must be used and be consistent with <var>$1urlparam</var>.\";'),('en','messages:apihelp-query+imageinfo-param-localonly','s:44:\"Look only for files in the local repository.\";'),('en','messages:apihelp-query+imageinfo-example-simple','s:82:\"Fetch information about the current version of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageinfo-example-dated','s:75:\"Fetch information about versions of [[:File:Test.jpg]] from 2008 and later.\";'),('en','messages:apihelp-query+images-description','s:47:\"Returns all files contained on the given pages.\";'),('en','messages:apihelp-query+images-param-limit','s:25:\"How many files to return.\";'),('en','messages:apihelp-query+images-param-images','s:85:\"Only list these files. Useful for checking whether a certain page has a certain file.\";'),('en','messages:apihelp-query+images-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+images-example-simple','s:46:\"Get a list of files used in the [[Main Page]].\";'),('en','messages:apihelp-query+images-example-generator','s:58:\"Get information about all files used in the [[Main Page]].\";'),('en','messages:apihelp-query+imageusage-description','s:46:\"Find all pages that use the 