ies to get:\";'),('en','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwprefix','s:33:\"Adds the prefix of the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwtitle','s:32:\"Adds the title of the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+iwbacklinks-example-simple','s:40:\"Get pages linking to [[wikibooks:Test]].\";'),('en','messages:apihelp-query+iwbacklinks-example-generator','s:58:\"Get information about pages linking to [[wikibooks:Test]].\";'),('en','messages:apihelp-query+iwlinks-description','s:49:\"Returns all interwiki links from the given pages.\";'),('en','messages:apihelp-query+iwlinks-param-url','s:57:\"Whether to get the full URL (cannot be used with $1prop).\";'),('en','messages:apihelp-query+iwlinks-param-prop','s:63:\"Which additional properties to get for each interlanguage link:\";'),('en','messages:apihelp-query+iwlinks-paramvalue-prop-url','s:18:\"Adds the full URL.\";'),('en','messages:apihelp-query+iwlinks-param-limit','s:35:\"How many interwiki links to return.\";'),('en','messages:apihelp-query+iwlinks-param-prefix','s:45:\"Only return interwiki links with this prefix.\";'),('en','messages:apihelp-query+iwlinks-param-title','s:68:\"Interwiki link to search for. Must be used with <var>$1prefix</var>.\";'),('en','messages:apihelp-query+iwlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+iwlinks-example-simple','s:55:\"Get interwiki links from the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+langbacklinks-description','s:284:\"Find all pages that link to the given language link.\n\nCan be used to find all links with a language code, or all links to a title (with a given language). Using neither parameter is effectively \"all language links\".\n\nNote that this may not consider language links added by extensions.\";'),('en','messages:apihelp-query+langbac