cription','s:43:\"List all pages using a given page property.\";'),('en','messages:apihelp-query+pageswithprop-param-propname','s:39:\"Page prop for which to enumerate pages.\";'),('en','messages:apihelp-query+pageswithprop-param-prop','s:39:\"Which pieces of information to include:\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-ids','s:17:\"Adds the page ID.\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-title','s:44:\"Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-value','s:32:\"Adds the value of the page prop.\";'),('en','messages:apihelp-query+pageswithprop-param-limit','s:38:\"The maximum number of pages to return.\";'),('en','messages:apihelp-query+pageswithprop-param-dir','s:27:\"In which direction to sort.\";'),('en','messages:apihelp-query+pageswithprop-example-simple','s:81:\"List the first 10 pages using <code>&#123;&#123;DISPLAYTITLE:&#125;&#125;</code>.\";'),('en','messages:apihelp-query+pageswithprop-example-generator','s:89:\"Get additional information about the first 10 pages using <code>_&#95;NOTOC_&#95;</code>.\";'),('en','messages:apihelp-query+prefixsearch-description','s:40:\"Perform a prefix search for page titles.\";'),('en','messages:apihelp-query+prefixsearch-param-search','s:14:\"Search string.\";'),('en','messages:apihelp-query+prefixsearch-param-namespace','s:21:\"Namespaces to search.\";'),('en','messages:apihelp-query+prefixsearch-param-limit','s:36:\"Maximum number of results to return.\";'),('en','messages:apihelp-query+prefixsearch-param-offset','s:26:\"Number of results to skip.\";'),('en','messages:apihelp-query+prefixsearch-example-simple','s:57:\"Search for page titles beginning with <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+protectedtitles-description','s:40:\"List all titles protected from creation.\";'),('en','messages:apihelp-query+protectedtitles-param-namespace','s:37:\"Only list titles in these namespaces.\";'),(