-prop-patrol','s:30:\"Tags edits that are patrolled.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-sizes','s:41:\"Adds the old and new lengths of the page.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-notificationtimestamp','s:65:\"Adds timestamp of when the user was last notified about the edit.\";'),('en','messages:apihelp-query+watchlist-paramvalue-prop-loginfo','s:39:\"Adds log information where appropriate.\";'),('en','messages:apihelp-query+watchlist-param-show','s:127:\"Show only items that meet these criteria. For example, to see only minor edits done by logged-in users, set $1show=minor|!anon.\";'),('en','messages:apihelp-query+watchlist-param-type','s:124:\"Which types of changes to show:\n;edit:Regular page edits.\n;external:External changes.\n;new:Page creations.\n;log:Log entries.\";'),('en','messages:apihelp-query+watchlist-param-owner','s:63:\"Used along with $1token to access a different user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-param-token','s:148:\"A security token (available in the user\'s [[Special:Preferences#mw-prefsection-watchlist|preferences]]) to allow access to another user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-simple','s:81:\"List the top revision for recently changed pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-props','s:111:\"Fetch additional information about the top revision for recently changed pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-allrev','s:84:\"Fetch information about all recent changes to pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-generator','s:75:\"Fetch page info for recently changed pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-generator-rev','s:80:\"Fetch revision info for recent changes to pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlist-example-wlowner','s:93:\"List the top revision for recently changed pages on the watchlist of user <kbd>Example</kbd>.\";'),('en','messages:apihelp-query+watchlistraw-description','s:46:\"Get all pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-param-namespace','s:40:\"Only list pages in the given namespaces.\";'),('en','messages:apihelp-query+watchlistraw-param-limit','s:45:\"How many total results to return per request.\";'),('en','messages:apihelp-query+watchlistraw-param-prop','s:35:\"Which additional properties to get:\";'),('en','messages:apihelp-query+watchlistraw-paramvalue-prop-changed','s:65:\"Adds timestamp of when the user was last notified about the edit.\";'),('en','messages:apihelp-query+watchlistraw-param-show','s:41:\"Only list items that meet these criteria.\";'),('en','messages:apihelp-query+watchlistraw-param-owner','s:63:\"Used along with $1token to access a different user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-param-token','s:148:\"A security token (available in the user\'s [[Special:Preferences#mw-prefsection-watchlist|preferences]]) to allow access to another user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-param-fromtitle','s:56:\"Title (with namespace prefix) to begin enumerating from.\";'),('en','messages:apihelp-query+watchlistraw-param-totitle','s:53:\"Title (with namespace prefix) to stop enumerating at.\";'),('en','messages:apihelp-query+watchlistraw-example-simple','s:43:\"List pages on the current user\'s watchlist.\";'),('en','messages:apihelp-query+watchlistraw-example-generator','s:58:\"Fetch page info for pages on the current user\'s watchlist.\";'),('en','messages:apihelp-revisiondelete-description','s:30:\"Delete and undelete revisions.\";'),('en','messages:apihelp-revisiondelete-param-type','s:42:\"Type of revision deletion being performed.\";'),('en','messages:apihelp-revisiondelete-param-target','s:63:\"Page title for the revision deletion, if required for the type.\";'),('en','messages:apihelp-revisiondelete-param-ids','s:44:\"Identifiers for the revisions to be deleted.\";'),('en','messages:apihelp-revisiondelete-param-hide','s:31:\"What to hide for each revision.\";'),('en','messages:apihelp-revisiondelete-param-show','s:33:\"What to unhide for each revision.\";'),('en','messages:apihelp-revisiondelete-param-suppress','s:63:\"Whether to suppress data from administrators as well as others.\";'),('en','messages:apihelp-revisiondelete-param-reason','s:38:\"Reason for the deletion or undeletion.\";'),('en','messages:apihelp-revisiondelete-example-revision','s:76:\"Hide content for revision <kbd>12345</kbd> on the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-revisiondelete-example-log','s:85:\"Hide all data on log entry <kbd>67890</kbd> with the reason <kbd>BLP violation</kbd>.\";'),('en','messages:apihelp-rollback-description','s:129:\"Undo the last edit to the page.\n\nIf the last user who edited the page made multiple edits in a row, they will all be rolled back.\";'),('en','messages:apihelp-rollback-param-title','s:81:\"Title of the page to roll back. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-rollback-param-pageid','s:82:\"Page ID of the page to roll back. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-rollback-param-user','s:51:\"Name of the user whose edits are to be rolled back.\";'),('en','messages:apihelp-rollback-param-summary','s:60:\"Custom edit summary. If empty, default summary will be used.\";'),('en','messages:apihelp-rollback-param-markbot','s:52:\"Mark the reverted edits and the revert as bot edits.\";'),('en','messages:apihelp-rollback-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-rollback-example-simple','s:81:\"Roll back the last edits to page <kbd>Main Page</kbd> by user <kbd>Example</kbd>.\";'),('en','messages:apihelp-rollback-example-summary','s:180:\"Roll back the last edits to page <kbd>Main Page</kbd> by IP user <kbd>192.0.2.5</kbd> with summary <kbd>Reverting vandalism</kbd>, and mark those edits and the revert as bot edits.\";'),('en','messages:apihelp-rsd-description','s:47:\"Export an RSD (Really Simple Discovery) schema.\";'),('en','messages:apihelp-rsd-example-simple','s:22:\"Export the RSD schema.\";'),('en','messages:apihelp-setnotificationtimestamp-description','s:222:\"Update the notification timestamp for watched pages.\n\nThis affects the highlighting of changed pages in the watchlist and history, and the sending of email when the \"{{int:tog-enotifwatchlistpages}}\" preference is enabled.\";'),('en','messages:apihelp-setnotificationtimestamp-param-entirewatchlist','s:26:\"Work on all watched pages.\";'),('en','messages:apihelp-setnotificationtimestamp-param-timestamp','s:53:\"Timestamp to which to set the notification timestamp.\";'),('en','messages:apihelp-setnotificationtimestamp-param-torevid','s:62:\"Revision to set the notification timestamp to (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-param-newerthanrevid','s:70:\"Revision to set the notification timestamp newer than (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-example-all','s:55:\"Reset the notification status for the entire watchlist.\";'),('en','messages:apihelp-setnotificationtimestamp-example-page','s:55:\"Reset the notification status for <kbd>Main page</kbd>.\";'),('en','messages:apihelp-setnotificationtimestamp-example-pagetimestamp','s:103:\"Set the notification timestamp for <kbd>Main page</kbd> so all edits since 1 January 2012 are unviewed.\";'),('en','messages:apihelp-setnotificationtimestamp-example-allpages','s:80:\"Reset the notification status for pages in the <kbd>{{ns:user}}</kbd> namespace.\";'),('en','messages:apihelp-stashedit-description','s:134:\"Prepare an edit in shared cache.\n\nThis is intended to be used via AJAX from the edit form to improve the performance of the page save.\";'),('en','messages:apihelp-stashedit-param-title','s:31:\"Title of the page being edited.\";'),('en','messages:apihelp-stashedit-param-section','s:83:\"Section number. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('en','messages:apihelp-stashedit-param-sectiontitle','s:28:\"The title for a new section.\";'),('en','messages:apihelp-stashedit-param-text','s:13:\"Page content.\";'),('en','messages:apihelp-stashedit-param-contentmodel','s:33:\"Content model of the new content.\";'),('en','messages:apihelp-stashedit-param-contentformat','s:53:\"Content serialization format used for the input text.\";'),('en','messages:apihelp-stashedit-param-baserevid','s:33:\"Revision ID of the base revision.\";'),('en','messages:apihelp-tag-description','s:67:\"Add or remove change tags from individual revisions or log entries.\";'),('en','messages:apihelp-tag-param-rcid','s:67:\"One or more recent changes IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-revid','s:61:\"One or more revision IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-logid','s:62:\"One or more log entry IDs from which to add or remove the tag.\";'),('en','messages:apihelp-tag-param-add','s:53:\"Tags to add. Only manually defined tags can be added.\";'),('en','messages:apihelp-tag-param-remove','s:98:\"Tags to remove. Only tags that are either manually defined or completely undefined can be removed.\";'),('en','messages:apihelp-tag-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-tag-example-rev','s:79:\"Add the <kbd>vandalism</kbd> tag to revision ID 123 without specifying a reason\";'),('en','messages:apihelp-tag-example-log','s:95:\"Remove the <kbd>spam</kbd> tag from log entry ID 123 with the reason <kbd>Wrongly applied</kbd>\";'),('en','messages:apihelp-tokens-description','s:136:\"Get tokens for data-modifying actions.\n\nThis module is deprecated in favor of [[Special:ApiHelp/query+tokens|action=query&meta=tokens]].\";'),('en','messages:apihelp-tokens-param-type','s:26:\"Types of token to request.\";'),('en','messages:apihelp-tokens-example-edit','s:37:\"Retrieve an edit token (the default).\";'),('en','messages:apihelp-tokens-example-emailmove','s:41:\"Retrieve an email token and a move token.\";'),('en','messages:apihelp-unblock-description','s:15:\"Unblock a user.\";'),('en','messages:apihelp-unblock-param-id','s:117:\"ID of the block to unblock (obtained through <kbd>list=blocks</kbd>). Cannot be used together with <var>$1user</var>.\";'),('en','messages:apihelp-unblock-param-user','s:90:\"Username, IP address or IP range to unblock. Cannot be used together with <var>$1id</var>.\";'),('en','messages:apihelp-unblock-param-reason','s:19:\"Reason for unblock.\";'),('en','messages:apihelp-unblock-example-id','s:33:\"Unblock block ID #<kbd>105</kbd>.\";'),('en','messages:apihelp-unblock-example-user','s:61:\"Unblock user <kbd>Bob</kbd> with reason <kbd>Sorry Bob</kbd>.\";'),('en','messages:apihelp-undelete-description','s:281:\"Restore revisions of a deleted page.\n\nA list of deleted revisions (including timestamps) can be retrieved through [[Special:ApiHelp/query+deletedrevs|list=deletedrevs]], and a list of deleted file IDs can be retrieved through [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('en','messages:apihelp-undelete-param-title','s:29:\"Title of the page to restore.\";'),('en','messages:apihelp-undelete-param-reason','s:21:\"Reason for restoring.\";'),('en','messages:apihelp-undelete-param-timestamps','s:129:\"Timestamps of the revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-fileids','s:127:\"IDs of the file revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('en','messages:apihelp-undelete-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-undelete-example-page','s:35:\"Undelete page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-undelete-example-revisions','s:52:\"Undelete two revisions of page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-upload-description','s:601:\"Upload a file, or get the status of pending uploads.\n\nSeveral methods are available:\n* Upload file contents directly, using the <var>$1file</var> parameter.\n* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.\n* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.\n* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.\nNote that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.\";'),('en','messages:apihelp-upload-param-filename','s:16:\"Target filename.\";'),('en','messages:apihelp-upload-param-comment','s:103:\"Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),('en','messages:apihelp-upload-param-text','s:32:\"Initial page text for new files.\";'),('en','messages:apihelp-upload-param-watch','s:15:\"Watch the page.\";'),('en','messages:apihelp-upload-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-upload-param-ignorewarnings','s:20:\"Ignore any warnings.\";'),('en','messages:apihelp-upload-param-file','s:14:\"File contents.\";'),('en','messages:apihelp-upload-param-url','s:27:\"URL to fetch the file from.\";'),('en','messages:apihelp-upload-param-filekey','s:67:\"Key that identifies a previous upload that was stashed temporarily.\";'),('en','messages:apihelp-upload-param-sessionkey','s:57:\"Same as $1filekey, maintained for backward compatibility.\";'),('en','messages:apihelp-upload-param-stash','s:90:\"If set, the server will stash the file temporarily instead of adding it to the repository.\";'),('en','messages:apihelp-upload-param-filesize','s:26:\"Filesize of entire upload.\";'),('en','messages:apihelp-upload-param-offset','s:25:\"Offset of chunk in bytes.\";'),('en','messages:apihelp-upload-param-chunk','s:15:\"Chunk contents.\";'),('en','messages:apihelp-upload-param-async','s:66:\"Make potentially large file operations asynchronous when possible.\";'),('en','messages:apihelp-upload-param-asyncdownload','s:33:\"Make fetching a URL asynchronous.\";'),('en','messages:apihelp-upload-param-leavemessage','s:76:\"If asyncdownload is used, leave a message on the user talk page if finished.\";'),('en','messages:apihelp-upload-param-statuskey','s:58:\"Fetch the upload status for this file key (upload by URL).\";'),('en','messages:apihelp-upload-param-checkstatus','s:52:\"Only fetch the upload status for the given file key.\";'),('en','messages:apihelp-upload-example-url','s:18:\"Upload from a URL.\";'),('en','messages:apihelp-upload-example-filekey','s:47:\"Complete an upload that failed due to warnings.\";'),('en','messages:apihelp-userrights-description','s:33:\"Change a user\'s group membership.\";'),('en','messages:apihelp-userrights-param-user','s:10:\"User name.\";'),('en','messages:apihelp-userrights-param-userid','s:8:\"User ID.\";'),('en','messages:apihelp-userrights-param-add','s:29:\"Add the user to these groups.\";'),('en','messages:apihelp-userrights-param-remove','s:34:\"Remove the user from these groups.\";'),('en','messages:apihelp-userrights-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-userrights-example-user','s:118:\"Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-example-userid','s:127:\"Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-watch-description','s:54:\"Add or remove pages from the current user\'s watchlist.\";'),('en','messages:apihelp-watch-param-title','s:55:\"The page to (un)watch. Use <var>$1titles</var> instead.\";'),('en','messages:apihelp-watch-param-unwatch','s:54:\"If set the page will be unwatched rather than watched.\";'),('en','messages:apihelp-watch-example-watch','s:36:\"Watch the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-watch-example-unwatch','s:38:\"Unwatch the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-watch-example-generator','s:48:\"Watch the first few pages in the main namespace.\";'),('en','messages:apihelp-format-example-generic','s:41:\"Return the query result in the $1 format.\";'),('en','messages:apihelp-dbg-description','s:54:\"Output data in PHP\'s <code>var_export()</code> format.\";'),('en','messages:apihelp-dbgfm-description','s:77:\"Output data in PHP\'s <code>var_export()</code> format (pretty-print in HTML).\";'),('en','messages:apihelp-json-description','s:27:\"Output data in JSON format.\";'),('en','messages:apihelp-json-param-callback','s:113:\"If specified, wraps the output into a given function call. For safety, all user-specific data will be restricted.\";'),('en','messages:apihelp-json-param-utf8','s:190:\"If specified, encodes most (but not all) non-ASCII characters as UTF-8 instead of replacing them with hexadecimal escape sequences. Default when <var>formatversion</var> is not <kbd>1</kbd>.\";'),('en','messages:apihelp-json-param-ascii','s:126:\"If specified, encodes all non-ASCII using hexadecimal escape sequences. Default when <var>formatversion</var> is <kbd>1</kbd>.\";'),('en','messages:apihelp-json-param-formatversion','s:251:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Experimental modern format. Details may change!\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('en','messages:apihelp-jsonfm-description','s:50:\"Output data in JSON format (pretty-print in HTML).\";'),('en','messages:apihelp-none-description','s:15:\"Output nothing.\";'),('en','messages:apihelp-php-description','s:37:\"Output data in serialized PHP format.\";'),('en','messages:apihelp-php-param-formatversion','s:251:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Experimental modern format. Details may change!\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('en','messages:apihelp-phpfm-description','s:60:\"Output data in serialized PHP format (pretty-print in HTML).\";'),('en','messages:apihelp-rawfm-description','s:78:\"Output data with the debugging elements in JSON format (pretty-print in HTML).\";'),('en','messages:apihelp-txt-description','s:51:\"Output data in PHP\'s <code>print_r()</code> format.\";'),('en','messages:apihelp-txtfm-description','s:74:\"Output data in PHP\'s <code>print_r()</code> format (pretty-print in HTML).\";'),('en','messages:apihelp-xml-description','s:26:\"Output data in XML format.\";'),('en','messages:apihelp-xml-param-xslt','s:144:\"If specified, adds the named page as an XSL stylesheet. The value must be a title in the {{ns:mediawiki}} namespace ending in <code>.xsl</code>.\";'),('en','messages:apihelp-xml-param-includexmlnamespace','s:36:\"If specified, adds an XML namespace.\";'),('en','messages:apihelp-xmlfm-description','s:49:\"Output data in XML format (pretty-print in HTML).\";'),('en','messages:apihelp-yaml-description','s:27:\"Output data in YAML format.\";'),('en','messages:apihelp-yamlfm-description','s:50:\"Output data in YAML format (pretty-print in HTML).\";'),('en','messages:api-format-title','s:20:\"MediaWiki API result\";'),('en','messages:api-format-prettyprint-header','s:372:\"This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set <kbd>format=$2</kbd>.\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('en','messages:api-format-prettyprint-header-only-html','s:200:\"This is an HTML representation intended for debugging, and is unsuitable for application use.\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('en','messages:api-orm-param-props','s:16:\"Fields to query.\";'),('en','messages:api-orm-param-limit','s:29:\"Max amount of rows to return.\";'),('en','messages:api-pageset-param-titles','s:28:\"A list of titles to work on.\";'),('en','messages:api-pageset-param-pageids','s:30:\"A list of page IDs to work on.\";'),('en','messages:api-pageset-param-revids','s:34:\"A list of revision IDs to work on.\";'),('en','messages:api-pageset-param-generator','s:166:\"Get the list of pages to work on by executing the specified query module.\n\n<strong>Note:</strong> Generator parameter names must be prefixed with a \"g\", see examples.\";'),('en','messages:api-pageset-param-redirects-generator','s:151:\"Automatically resolve redirects in <var>$1titles</var>, <var>$1pageids</var>, and <var>$1revids</var>, and in pages returned by <var>$1generator</var>.\";'),('en','messages:api-pageset-param-redirects-nogenerator','s:102:\"Automatically resolve redirects in <var>$1titles</var>, <var>$1pageids</var>, and <var>$1revids</var>.\";'),('en','messages:api-pageset-param-converttitles','s:171:\"Convert titles to other variants if necessary. Only works if the wiki\'s content language supports variant conversion. Languages that support variant conversion include $1.\";